import React, { Fragment } from "react";
import { rutaAPI } from "../../config/Config";
import Encabezado from "../../components/Encabezado";
import Tabla from "../../components/tabla/Tabla";

class Prospecto extends React.Component {
  state = {
    data: [],
    error: null,
  };

  async componentDidMount() {
    await this.fetchProspectos();
  }

  fetchProspectos = async () => {
    try {
      let res = await fetch(`${rutaAPI}/mostrar-prospecto`);
      let data = await res.json();

      if (data.status === 200) {
        console.log("Sin Errores");
        this.setState({
          data: data.data,
        });
      }
    } catch (error) {
      this.setState({
        error,
      });
    }
  };

  render() {
    return (
      <Fragment>
        <div className="content-wrapper">
          <div className="container">
            <Encabezado titulo="Prospectos" />
            <div className="row">
              <div className="card card-primary card-outline">
                <div className="card-header">
                  <h5 className="m-0">
                    <button className="btn btn-primary">
                      Agregar Nuevo Prospecto
                    </button>
                  </h5>
                </div>
                <div className="card-body">
                  <Tabla
                    cabeceras={[
                      "#",
                      "Nombre",
                      "Calle",
                      "Colonia",
                      "Código Postal",
                      "Teléfono",
                      "RFC",
                      "Acciones",
                    ]}
                    prospectos={this.state.data}
                  />
                </div>
              </div>
            </div>
          </div>
        </div>
      </Fragment>
    );
  }
}
export default Prospecto;
